class HeaderJobs extends React.Component {

  constructor(props) {
      super(props);
      this.state={
        myJobCount: this.props.myJobCount,
    }
  };

  updateMyJobCount = () => {
    this.setState({myJobCount: this.props.myJobCount});

  }

  componentDidUpdate() {
    if (this.props.onChange) {
      this.updateMyJobCount();
    }
  }

  render() {
    let goHome = this.props.goToHome;
    let goMyJobs = this.props.goToMyJobs;

    console.log(this.state.myJobCount);

    return (
      <div className="header">
