          <div className="logo" onClick={goHome}> Electry </div>
          <div className="settings">
            <img src={myJobs} onclick={goMyJobs} />
            <div className="between">


            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default HeaderJobs;
